import React from "react";

import Common from "./Common";

const Home = () => {
    return (
        <>
           <Common
            name='Grow your business with' 
             img src={PaymentResponse.imgsrc} 
             visit="/service" 
             btName="Get Started" 
           />

        </>

    );

};
export default Home;
